import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a category to get to product listing page
    await page.waitForSelector('text=Electronics', { timeout: 5000 });
    await page.click('text=Electronics');
    await page.waitForLoadState('networkidle');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_selected.png'));

    // Wait for sort controls and apply price filter
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.selectOption('#sortSelect', 'price-low');
    await page.waitForLoadState('networkidle');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sort_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sort_applied.png'));

    // Verify the sort was applied by checking the select value
    const sortValue = await page.$eval('#sortSelect', select => select.value);
    const productPrices = await page.$$eval('.product-price', prices => 
      prices.map(p => parseFloat(p.textContent.replace('$', '')))
    );

    return {
      success: true,
      action: "Applied price sort filter (low to high) on electronics category",
      extractedData: {
        sortType: sortValue,
        productCount: productPrices.length,
        lowestPrice: Math.min(...productPrices),
        highestPrice: Math.max(...productPrices)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
